package it.pisa.jade.agents.peerAgent.ontologies;import jade.content.AgentAction;/** *  * @author Fabrizio Marozzo * */@SuppressWarnings("serial")public class LookFor implements AgentAction {	private String searchKey;		private String searchString;	private String extension;	private String type;	public String getExtension() {		return extension;	}	public void setExtension(String extension) {		this.extension = extension;	}	public String getSearchString() {		return searchString;	}	public void setSearchString(String searchString) {		this.searchString = searchString;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getSearchKey() {		return searchKey;	}	public void setSearchKey(String searchKey) {		this.searchKey = searchKey;	}}